                    <div class="service-card"> <!---4444-->
                        <div class="icon"><i class="fas fa-laptop"></i> </div> 
                        <h4> Check Laptop Performance Issues</h4>
                        <p>Lagging usually comes from low RAM, slow storage, or too many background tasks.
                        Fixes:
                     Uninstall bloatware: Remove unused apps.
                     Disable startup programs:
                     Open Task Manager → Startup → Disable unnecessary ones.
                     Use “High Performance” mode:
                     Control Panel → Power Options → High Performance.
                     Clean up disk: Use “Disk Cleanup” or Win + R → cleanmgr. </p>
                    </div>
                </div>
                <div class="col-md-6 col-lg-4 mb-4">
                    <div class="service-card">
                        <div class="icon"><i class="fas fa-fire"></i></div>
                        <h4>Fix or Prevent Overheating </h4>
                        <p>Overheating can slow performance and damage components.
                       Fixes:
                     Clean air vents and fans: Dust buildup blocks airflow.
                    Use a cooling pad: Cheap and effective for gaming/coding sessions.
                    Limit background CPU usage:
                    Open Task Manager → sort by CPU → end unnecessary tasks.
                    Reapply thermal paste (if you're comfortable or get a technician to do it). </p>
                    </div>
                </div>
                <div class="col-md-6 col-lg-4 mb-4">
                    <div class="service-card">
                        <div class="icon"> <i class="fa-solid fa-battery-quarter"></i></div> 
                        <h4> Battery Life Improvements</h4>
                        <p> If your battery drains fast: 
                            Fixes:
                        Lower screen brightness.
                       Turn off keyboard backlight (if available).
                       Use Battery Saver Mode (Windows 10/11).
                       Stop background sync (OneDrive, Discord, Chrome tabs).
                       If the battery is old (2-3 years), consider replacing it </p>
                    </div>
                </div>
                <div class="col-md-6 col-lg-4 mb-4">
                    <div class="service-card">
                        <div class="icon"> <i class="fa-solid fa-arrow-up-from-bracket"></i></div> 
                        <h4> Upgrade Hardware (RAM, SSD, etc.)</h4>
                        <p>This gives the biggest improvement for performance.
                        Recommendations:
                        RAM:
                        Minimum for coding: 8 GB
                        Ideal for gaming/design: 16-32 GB
                        Check your laptop model's max RAM limit.

                        SSD:
                        If you're still on HDD → upgrade to SSD (NVMe preferred).
                        SSDs make boot-up and loading up to 5x faster </p>
                    </div>
                </div>
                 <div class="col-md-6 col-lg-4 mb-4">
                    <div class="service-card">
                        <div class="icon"> <i class="fa-solid fa-code-branch"></i></div> 
                        <h4> For Coding</h4>
                        <p>Use lightweight editors (VS Code, Sublime, etc.).
                        Close browsers or use fewer extensions.
                        Install WSL2 (if you code in Linux environments on Windows).
                        Get at least 8 GB RAM and an SSD for smooth compiling/debugging. </p>
                    </div>
                </div>
                <div class="col-md-6 col-lg-4 mb-4">
                    <div class="service-card">
                        <div class="icon"><i class="fa-solid fa-pen"></i> </div>
                        <h4>For Design (Photoshop, Illustrator, 3D, etc.) </h4>
                        <p>Use an SSD and at least 16 GB RAM.
                        For 3D or video editing: a dedicated GPU (NVIDIA GTX/RTX or AMD Radeon).
                        Calibrate your display for accurate colors.
                        Store project files on SSD, archives on HDD/external drive. </p>
                    </div>
                </div>
            </div>
        </div>
